//     primry_color: '#28A745',
//     primary_text_color: 'white',
// }

const GlobalStyleSheet = {
    // primry_color: '#563D7C',
    primry_color: '#28A745',
    admin_primry_color: '#272822',
    primary_text_color: 'white',

    // Body color
    body_color: '#DDE1E3',
    // body_color: '#F0F0F0',

    // Fontsize for all the labels of any form control (input, textbox etc):
    form_label_fontsize: '13px',
}

export default GlobalStyleSheet;
